import { useState } from "react";

function App() {

  const [number1 , setCount] = useState('');
  const [number2 , setCount1] = useState('');  

  const handleChange = event => {
    setCount(event.target.value);
    console.log('value is:', event.target.value);
  };

  const handleChange1 = event => {
    setCount1(event.target.value);
    console.log('value is:', event.target.value);
  };

  const add = () => {
    const result = number1 + number2;
  };

  const sub = () => {
    alert('sub');
  };

  const mul = () => {
    alert('mul');
  };

  const div = () => {
    alert('div');

  };

  return (
    <div className="center">
      <p>First Try</p>
      <label htmlFor="number 1">Number 1 : </label>
      <input 
      type="text"
      placeholder="number 1"
      id="number1"
      onChange={handleChange}
      value={number1}
      /> <br /> <br />

      <label htmlFor="number 2">Number 2 : </label>
      <input 
      type="text"
      placeholder="number 2"
      id="number2"
      onChange={handleChange1}
      value={number2}
      /> <br />

      <h2 id="result">Result is {}</h2> 
      <button onClick={() => add(number1 + number2)}>Add</button> &nbsp;
      <button onClick={() => sub()}>Sub</button> &nbsp;
      <button onClick={() => mul()}>Mul</button> &nbsp;
      <button onClick={() => div()}>Div</button> 
    </div>
  );
}

export default App;
